const Education = () => {
  const education = [
    {
      degree: 'Bachelor of Computer Science',
      institution: 'State University',
      year: '2016 - 2020',
      description: 'Foundation in Computer Science and Programming'
    }
  ];

  return (
    <section id="education" className="section-padding bg-light" role="region" aria-labelledby="education-title">
      <div className="container">
        <h2 id="education-title" className="section-title h1">Education</h2>
        <div className="timeline">
          {education.map((edu, index) => (
            <article className="timeline-item" key={index} data-aos="fade-right" data-aos-delay={index * 200}>
              <h3 className="h4 text-primary">{edu.degree}</h3>
              <h4 className="h6 text-muted mb-2">{edu.institution}</h4>
              <time className="badge bg-primary mb-2">{edu.year}</time>
              <p>{edu.description}</p>
            </article>
          ))}
        </div>
      </div>
    </section>
  );
};
export default Education;
